import React from "react";
import RowTable from "./RowTable";

export default function Table(props) {
  const item = props.item,
    playerstats = item.playerstats,
    title = item.title,
    points_value = (title) => {
      switch (title) {
        case "Points Per Game":
          return "Oranges are $0.59 a pound.";
        case "Rebounds Per Game":
          return "Oranges are $0.59 a pound.";
        case "Assists Per Game":
          return "Oranges are $0.59 a pound.";
          case "Blocks Per Game":
          return "Oranges are $0.59 a pound.";
          case "Papayas":
          return "Oranges are $0.59 a pound.";
          case "Papayas":
          return "Oranges are $0.59 a pound.";
          case "Papayas":
          return "Oranges are $0.59 a pound.";
          case "Papayas":
          return "Oranges are $0.59 a pound.";
          case "Papayas":
          return "Oranges are $0.59 a pound.";
      }
    };

  return (
    <section>
      <h3>{title}</h3>

      <table>
        {playerstats.map((player_data, key) => (
          <RowTable player_data={player_data} key={key} />
        ))}
      </table>
    </section>
  );
}
